$(document).ready(function() {
	var filterParams = document.location.search.replace('?', '').split('&');

	for (var i = 0; i < filterParams.length; i++) {
		var filterParam = filterParams[i].split('=');
		switch (filterParam[0]) {
			case 'floorMin':
			case 'squareMin':
				//case 'terMin':
				$('input[name="' + filterParam[0] + '"]').val(filterParam[1]);
				//$('.uislider[data-target1="' + filterParam[0] + '"]').data('min', filterParam[1]);
				//console.log($('.uislider[data-target1="' + filterParam[0] + '"]'));
				break;
			case 'floorMax':
			case 'squareMax':
				//case 'terMax':
				$('input[name="' + filterParam[0] + '"]').val(filterParam[1]);
				//$('.uislider[data-target2="' + filterParam[0] + '"]').data('max', filterParam[1]);
				break;
			case 'view':
			case 'side':
				$('select[name="' + filterParam[0] + '"] option[value="' + filterParam[1] + '"]').prop('selected', 'selected');
				break;
			case 'block':
			case 'type':
				if (filterParam[1] != '0') {
					$('select[name="block"] option[value="' + filterParam[1] + '"]').prop('selected', 'selected');
				}
				break;
			case 'rooms[]':
				$('input[name="' + filterParam[0] + '"][value="' + filterParam[1] + '"]').prop('checked', 'checked');
				break;
		}
	}
	if ($('input[name="rooms[]"]:checked').length == $('input[name="rooms[]"]').length) {
		$('input[name="rooms[]"]').prop('checked', false);
	}

	menu.init();
	page.init();
	
}); 
  
