var menu = { 
	cur: '',
	fixed:'',
	timer: '',
	still_need_to_hide: true,
	init: function() {
		
		var bind=isTouchDevice() ? 'touchstart' : 'mouseenter';
		
		$('.menu_lnk').bind(bind, function(e) {
			e.stopPropagation();
			menu.still_need_to_hide = false;
			clearTimeout(menu.timer);
			var t=$(this);
			menu.timer=setTimeout( function() {
				if (!menu.still_need_to_hide) {
					 menu.show_menu( t.attr('rel') );
					 menu.cur = t.attr('rel');
				}
			}, 350 );
			
		});
		
		$('.menu').bind(bind, function(e) {
			e.stopPropagation();
			menu.still_need_to_hide = false;
			menu.cur = $(this).attr('id');
		});
		
		if ( isTouchDevice() ) {
			$('.menu_lnk a').removeClass('pjax');
			$('.menu_lnk a').on('click', function(e) {e.preventDefault(); } );
			$('.menu').on( 'touchstart', function(e) {
				e.stopPropagation();
			});
			
			$('body').on( 'touchstart', function(e) {
				menu.still_need_to_hide = true;
				clearTimeout(menu.timer);
				setTimeout(function() { menu.hide_if_needed(); }, 500);
			} );
		}
		
		
		else {
			
			$('.menu_lnk').bind('mouseleave', function() {
				menu.still_need_to_hide = true;
				clearTimeout(menu.timer);
				setTimeout(function() { menu.hide_if_needed(); }, 800);
			});
			
			$('.menu').bind('mouseleave', function() {
				menu.still_need_to_hide = true;
				clearTimeout(menu.timer);
				setTimeout(function() { menu.hide_if_needed(); }, 800);
			});
		}
	},
	show_menu: function(cls) {
		$('header *').stop();
		var m = $('#' + cls );
		/*if (typeof(eval(page.id)) == 'object' && eval(page.id).stop_moving) {
			eval(page.id).stop_moving();
		}*/

		$('.menu_lnk').removeClass('hover');
		$('.menu_lnk[rel='+cls+']').addClass('hover');
		$('menu').addClass('opened');
		m.addClass('opened');
		if (cls=='mdrn_menu')
			$('.menu, .menu_lnk').addClass('type2');
		 else $('.menu, .menu_lnk').removeClass('type2');

		if (m.siblings('.menu.opened').length > 0) {
				m.siblings('.menu.opened').removeClass('opened').stop().css({'z-index': 1, height:'0px'});
				m.stop().css({'z-index': 5, height:'55px'});
		}
		else m.css({'z-index': 5}).stop().animate({height:'55px'},500 );
		
	},
	hide_menu: function(start) {
		$('.menu_lnk').removeClass('hover');

		if ( menu.fixed ) {
			menu.show_menu(menu.fixed);
			return;
		}
		$('menu').removeClass('opened');
		$('.menu').removeClass('opened').css({'z-index': 1}).transition({'height': 0}, 500, function() {
			setTimeout(function() {
				/*if ((typeof(start) == 'undefined' || start != false) && typeof(eval(page.id)) == 'object' && !$('menu').hasClass('opened') && !eval(page.id).moving && eval(page.id).start_moving) {
					eval(page.id).start_moving();
					$('.menu, .menu_lnk').removeClass('type2');
				}*/
				$('.menu, .menu_lnk').removeClass('type2');
			}, 100);
		});

	},
	hide_if_needed: function() {
		if (menu.still_need_to_hide && $('.ajax-loader').css('display')=='none' ) {
			menu.hide_menu();
		}
	}
};

