var lobbi = {
	inited: false,
	activeSlide: 0,
	slide: '',
	num: 0,
	duration: 1000,
	pause: 13000,
	timer: null,
	moving: false,
	allowmove:true,
	init: function() {
		lobbi.hide_ambient();
		
		lobbi.slide = $('.lobbi-slide');
		lobbi.text = $('.lobbi-text');
		lobbi.num = lobbi.slide.size();
		
		if ( $('.dots').length > 0 ) 
			for (var i=0; i< lobbi.num; i++)
				$('.dots').append('<a href="'+i+'" class="dot"><span></span></a>');
		
		$('.lobbi-prev').bind('click', function() { lobbi.move('prev'); });
		$('.lobbi-next').bind('click', function() { lobbi.move('next'); });
		$('.dots .dot').bind('click', function(e) { e.preventDefault(); lobbi.move( $(this).attr('href') ); });
		
		
		$('main').waitForImages({
			finished: function() {
				lobbi.ready();
				lobbi.resize();
			},
			waitForAll: true
		});
		
		
		if ( isTouchDevice() )
			$('main').swipe({
				swipeLeft: function(event, direction, distance, duration, fingerCount) {
					lobbi.move("next");
				},
				swipeRight: function(event, direction, distance, duration, fingerCount) {
					lobbi.move("prev");
				},
				threshold: 100
		});
		
		//if ( $('.garden').length > 0 ) { garden.init(); };
		
	},
	hide_ambient: function() {
		$('.lobbi-slide').css({opacity: 0});
	},
	show_ambient: function() {
		lobbi.slide.find('.text .in').css({opacity: 0});
		lobbi.slide.css({opacity: 0}).eq(0).addClass('active').velocity({opacity: 1}, lobbi.duration );
		lobbi.slide.eq(0).find('.text .in').delay(lobbi.duration).velocity({opacity: 1}, lobbi.duration*0.7 );
	},
	ready: function() {
		lobbi.inited = true;
		lobbi.activeSlide = 0;
		$('.dots .dot').eq(0).addClass('active');
		page.ready(function() {
			lobbi.show_ambient();
			lobbi.start_moving(false, lobbi.pause/2);
		});
	},
	move: function(dir) {
		if (/*lobbi.moving || $('menu').hasClass('opened') || */ (!$('.body').hasClass('lobbi') && !$('.body').hasClass('garden')))

		$('*').velocity("stop");
		if (lobbi.moving) $('.lobbi-slide').removeClass('active');
		
		lobbi.stop_moving(true);
		lobbi.moving = true;

		if (dir == 'next') {
			var newActive = lobbi.activeSlide < lobbi.num - 1 ? lobbi.activeSlide + 1 : 0;
		}
		if (dir == 'prev') {
			var newActive = lobbi.activeSlide > 0 ? lobbi.activeSlide - 1 : lobbi.num - 1;
		}
		if ( parseInt(dir) || parseInt(dir) === 0 ) {
			var newActive = parseInt(dir);
		}
		var nextSlide = lobbi.slide.eq(newActive);
		$('.dots .dot').removeClass('active');
		$('.dots .dot').eq(newActive).addClass('active');
		nextSlide.siblings('.lobbi-slide').find('.text .in').velocity({opacity: 0}, lobbi.duration* 0.5);

		nextSlide.css({opacity: 0, 'z-index': 10}).addClass('active').velocity({opacity: 1}, lobbi.duration, function() {
			nextSlide.css({'z-index': 5});
			nextSlide.siblings('.lobbi-slide').removeClass('active').css({'z-index': 1});
			lobbi.moving = false;
			lobbi.activeSlide = newActive;
			lobbi.start_moving(true);
		}); 
		
		nextSlide.find('.text .in').css({opacity: 0}).delay(lobbi.duration).velocity({opacity: 1}, lobbi.duration* 0.7); 
	},
	stop_moving: function(ignore) {
		clearTimeout(lobbi.timer);
		if(!ignore) lobbi.allowmove=false;
		lobbi.moving = false;
		lobbi.slide.stop();
	},
	start_moving: function(getallow, pause) {
		if (getallow && !lobbi.allowmove) return;
		clearTimeout(lobbi.timer);
		if (!pause) pause=lobbi.pause;
		lobbi.allowmove=true;
		lobbi.timer = setTimeout(function() {
			if (lobbi.moving || (!$('.body').hasClass('lobbi') && !$('.body').hasClass('garden'))) return;
			lobbi.move('next');
		}, pause);
	},
	
	resize:function(){
		$('.lobbi-slide').css('top', $('header').outerHeight() + 'px');
		$('.lobbi-slide').css('bottom', $('footer').outerHeight() + 'px');
	}
};


