var gallery = { 
	speed:350,
	slideWidth:0,
	nWidth:0,
	nw:0,
	init: function(){
		
		page.ready(function() {
			gallery.resize();
			setTimeout ( gallery.show_ambient, 500);
		});
		
		
	},
	
	show_ambient: function(){
		$('.albums .item').velocity({opacity:1}, gallery.speed*3);
		setTimeout(function(){ gallery.ready(); }, gallery.speed);
	},
	
	resize:function(){
		
		gallery.slideWidth = $('main').width() / $('.albums .item').length;
		gallery.nWidth = gallery.slideWidth + gallery.slideWidth / 3;
		var dWidth=gallery.slideWidth / 3;
		gallery.nw = gallery.slideWidth - dWidth / ( $('.albums .item').length -1  );
		$('.albums .item').css('width', gallery.slideWidth + 'px');
		
		$('.albums').css('bottom', $('footer').outerHeight() + 'px');
	},
	
	ready:function(){
		$('.albums').addClass('ready');
		$('.albums .item').mouseenter( function(){
			$('*').velocity("stop");
				$(this).find('.tone').velocity({opacity:0}, gallery.speed);
				$(this).find('.line').velocity({opacity:0}, gallery.speed);
				$(this).velocity({'width':gallery.nWidth+'px'}, gallery.speed);

				$(this).siblings('.item').velocity({'width':gallery.nw+'px'},  gallery.speed);

				$(this).siblings('.item').find('.tone, .line').velocity({opacity:1}, gallery.speed);

			
		} );
		
		$('.albums').mouseleave(function(){
			$('*').velocity("stop");
			$('.albums .item').velocity({'width':gallery.slideWidth+'px'}, gallery.speed);
			$('.albums .item .tone, .albums .item .line').velocity({opacity:1}, gallery.speed);
		});
	}
}; 


