	fill_table: function(){
		
		var rooms=[];

		var floorMin=parseInt( $('[name=floorMin]').val() );
		var floorMax=parseInt( $('[name=floorMax]').val() );
		var squareMin=parseInt( $('[name=squareMin]').val() );
		var squareMax=parseInt( $('[name=squareMax]').val() );
		var terMin=parseInt( $('[name=terMin]').val() );
		var terMax=parseInt( $('[name=terMax]').val() );
		var view=parseInt( $('[name=view]').val() );
		var side=parseInt( $('[name=side]').val() );

		 if ($('[name="rooms[]"]:checked').length==0)
			$('[name="rooms[]"]').each(function(){
				rooms.push(parseInt($(this).val()));
			});
		 else $('[name="rooms[]"]:checked').each(function(){
				rooms.push(parseInt($(this).val()));
			});
		
		var block=$('[name=block]').val() ;
		var type;
		if ( block.indexOf('type') != -1 ) {
			type=block;
			block=0;
		} else {
			type="";
			block=parseInt(block);
		}

		var queryString = '?floorMin=' + floorMin +
			'&floorMax=' + floorMax +
			'&squareMin=' + squareMin +
			'&squareMax=' + squareMax +
			//'&terMin=' + terMin +
			//'&terMax=' + terMax +
			'&view=' + view +
			'&side=' + side +
			'&block=' + block +
			'&type=' + type +
			(rooms.length > 0 ? '&rooms[]=' + rooms.join('&rooms[]=') : '') ;
		var skipParams = [
			'floorMin',
			'floorMax',
			'squareMin',
			'squareMax',
			'terMin',
			'terMax',
			'view',
			'side',
			'block',
			'type',
			'rooms[]'
		];
		var oldQueryParams = document.location.search.substr(1).split('&');
		for (var pp = 0; pp < oldQueryParams.length; pp++) {
			var ppname = oldQueryParams[pp].split('=')[0];
			if (skipParams.indexOf(ppname) == -1) {
				queryString += '&' + oldQueryParams[pp];
			}
		}

		if (window.history.pushState) window.history.pushState({}, document.title, queryString);
		if (ga) {
			ga('send', 'pageview', {
				'page': queryString,
				'title': document.title
			});
			
			setTimeout(function() {
				if (yaCounter26723793) {
					yaCounter26723793.hit(queryString);
				}
			}, 2500);
		}
		
		$('.flats-table tbody').html('');
		
		var flats= flats_data.filter(function(element, index, array) {
			return (  ( type ? element.type==type : true ) && 
					( block ? element.block==block : true )  && 
					( view ? element.view==view : true ) && 
					( side ? element.side==side : true ) && 
					element.floor <= floorMax && element.floor >= floorMin && 
					element.squareAll <= squareMax && element.squareAll >= squareMin && 
					//element.squareTer <= terMax && element.squareTer >= terMin && 
					rooms.indexOf(element.rooms)!=-1 
			);
		});
		
		if (flats.length == 0) {
			$('.flats-data .empty').show();
			$('.flats-table').hide();
		}
		else {
			$('.flats-data .empty').hide();
			$('.flats-table').show();
			for (var i=0; i<flats.length; i++) {
				var flat=flats[i];
				$('.flats-table tbody').append('<tr data-id="' + flat.id + '">'+
							'<td>'+flat.blockName+'</td>'+
							'<td>'+flat.typeName+'</td>'+
							'<td>'+flat.section+'</td>'+
							'<td>'+flat.floor+'</td>'+
							'<td>'+flat.rooms+'</td>'+
							'<td>'+numeric_format(flat.squareAll)+' м<sup>2</sup></td>'+
							//'<td>'+flat.squareTer+' м<sup>2</sup></td>'+
							'<td>'+flat.sideName+'</td>'+
							'<td>'+flat.viewName+'</td>'+
					'</tr>');
			}
			$('.flats-table tbody tr').bind('click', function() {
				params.showFlat($(this).attr('data-id'));
			});
		}
		$(".flats-table").trigger('update');
		
	},
	
